@RestController
@RequestMapping(value = "/rest/events")
public class EventRestController {

    private EventLogService eventLogService;
    private CarEventService carEventService;

    public EventRestController(EventLogService eventLogService, CarEventService carEventService) {
        this.eventLogService = eventLogService;
        this.carEventService = carEventService;
    }

    @PostMapping
    public Page<EventsDto> list(@RequestBody PagingRequest pagingRequest, @RequestParam String dateFromString, @RequestParam String dateToString,
                                    @RequestParam String plateNumber, @RequestParam Long gateId, @RequestParam EventLog.EventType eventType) throws ParseException {
        EventFilterDto eventFilterDto = new EventFilterDto();
        eventFilterDto.setDateFromString(dateFromString);
        eventFilterDto.setDateToString(dateToString);
        eventFilterDto.setPlateNumber(plateNumber);
        eventFilterDto.setGateId(gateId);
        eventFilterDto.setEventType(eventType);
        return eventLogService.getEventLogs(pagingRequest,eventFilterDto);
    }

    @PreAuthorize("hasRole('ROLE_ADMIN')")
    @GetMapping(value = "/check/{propertyName}")
    public String openGate(@PathVariable("propertyName") String propertyName) throws Exception {
        /*if("camera".equals(propertyName)){
            String photo = "";
            CarEventDto eventDto = new CarEventDto();
            eventDto.car_number = "673ERT222";
            eventDto.event_date_time = new Date();
            eventDto.car_picture = photo;
            eventDto.ip_address = "99.98.97.96";
            carEventService.saveCarEvent(eventDto);
        }*/
        return eventLogService.getApplicationPropertyValue(propertyName);
    }

    @GetMapping(value = "/excel")
    public String eventExcel(@RequestParam String dateFromString, @RequestParam String dateToString,
                             @RequestParam String plateNumber, @RequestParam Long gateId) throws Exception {
        EventFilterDto eventFilterDto = new EventFilterDto();
        eventFilterDto.setDateFromString(dateFromString);
        eventFilterDto.setDateToString(dateToString);
        eventFilterDto.setPlateNumber(plateNumber);
        eventFilterDto.setGateId(gateId);
        return eventLogService.getEventExcel(eventFilterDto);
    }
}
